Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (3,'【重要】ロッカー定期点検のお知らせ','安全確保のため、来週火曜 02:00–04:00 に定期点検を実施します。点検中は一部ロッカーがご利用いただけません。',1,to_timestamp('25/09/03 16:00:54.987597000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (5,'【大型】特大サイズロッカー増設','スーツケースXL対応の特大ロッカーを南改札外に12台増設しました。混雑時は係員にお声がけください。',1,to_timestamp('25/09/03 16:02:24.940196000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (1,'【重要】ロッカー定期点検のお知らせ','安全確保のため、来週火曜 02:00–04:00 に定期点検を実施します。点検中は一部ロッカーがご利用いただけません。',1,to_timestamp('25/09/03 16:04:04.474424000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (2,'【料金改定】一部サイズの料金変更','運用コスト見直しのため、来月1日よりLサイズの料金を1日あたり100円値上げします。S/Mサイズは据え置きです。',2,to_timestamp('25/09/03 16:04:04.486140000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (4,'【大型】特大サイズロッカー増設','スーツケースXL対応の特大ロッカーを南改札外に12台増設しました。混雑時は係員にお声がけください。',1,to_timestamp('25/09/03 16:04:04.518256000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (6,'【鍵紛失】対応と手数料','鍵紛失時は身分証の提示と所定の書類記入が必要です。交換手数料として別途費用が発生します。管理カウンターまで。',3,to_timestamp('25/09/03 16:04:04.551196000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (7,'【台風対応】安全確保のための一時休止','荒天時は安全のため一部エリアを閉鎖する場合があります。最新情報は掲示および館内アナウンスをご確認ください。',1,to_timestamp('25/09/03 16:04:04.560480000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (8,'【繁忙期】ゴールデンウィーク混雑予想','GW期間はロッカーの空きが少なくなります。できるだけ早めの確保と、サイズのご確認をおすすめします。',2,to_timestamp('25/09/03 16:04:04.571168000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (9,'【臨時設置】夏祭り期間の臨時ロッカー','イベント期間中、中央口前に臨時ロッカーを設置します。台数に限りがありますので譲り合ってご利用ください。',3,to_timestamp('25/09/03 16:04:04.580415000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (10,'【清掃】定期清掃・消毒の実施','快適にご利用いただくため、毎日深夜にロッカー内外の清掃・消毒を行っています。清掃中は一時的に利用停止となります。',1,to_timestamp('25/09/03 16:04:04.589409000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (11,'【停電点検】計画停電に伴う一時停止','電気設備点検のため、来週木曜 01:30–03:30 は一部スマートロッカーの解錠が遅延する場合があります。',2,to_timestamp('25/09/03 16:04:04.599559000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (12,'【返金対応】機器不具合時について','機器不具合による重複課金等は現場確認のうえ返金いたします。レシートをお持ちのうえ管理カウンターまで。',3,to_timestamp('25/09/03 16:04:04.609852000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (13,'【案内図】ロッカー位置マップ更新','館内改装に伴いロッカー配置図を更新しました。サイズ別の位置は最新のフロアマップをご参照ください。',1,to_timestamp('25/09/03 16:04:04.621986000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (14,'【予約】一部エリアで事前予約導入','対象ロッカーで事前予約サービスの試行を開始しました。対象と利用方法は掲示のQRコードからご確認ください。',2,to_timestamp('25/09/03 16:04:04.631474000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (15,'【持込禁止】危険物等の保管禁止','可燃物・危険物・生もの・動物などの保管は禁止です。発見時は安全のため撤去・通報する場合があります。',3,to_timestamp('25/09/03 16:04:04.641228000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (16,'【最長保管】保管制限と処理について','保管は最長72時間までです。期限経過品は規約に基づき処理し、費用を請求する場合があります。',1,to_timestamp('25/09/03 16:04:04.649710000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (17,'【問い合わせ】管理センター連絡先','お困りの際は管理センターまでご連絡ください。現場係員が不在の場合は掲示の電話番号へおかけください。',2,to_timestamp('25/09/03 16:04:04.658542000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (18,'【防犯】カメラ作動中','安全のためロッカー周辺は防犯カメラを常時作動しています。ご理解とご協力をお願いいたします。',3,to_timestamp('25/09/03 16:04:04.668060000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (19,'【お願い】利用証明書・レシート保管','返金・照会にはレシートや利用証明書が必要です。ご利用中は破棄せず大切に保管してください。',1,to_timestamp('25/09/03 16:04:04.677449000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (20,'【迷子防止】ロッカー番号控えの推奨','ロッカー番号と設置場所を写真で控えてください。場所が思い出せない場合は係員にお申し出ください。',2,to_timestamp('25/09/03 16:04:04.687034000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (21,'【サイズ】投入前のサイズ確認','扉が閉まらない荷物は保管できません。無理な収納は故障や追加費用の原因となりますのでご注意ください。',3,to_timestamp('25/09/03 16:04:04.696015000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (22,'【年末年始】営業時間の一部変更','年末年始は一部エリアで短縮運用となります。営業時間は掲示または公式案内をご確認ください。',1,to_timestamp('25/09/03 16:04:04.707037000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (23,'【IC決済】交通系ICの残高不足','解錠時に残高不足の場合、差額精算が必要です。最寄りのチャージ機をご利用ください。',2,to_timestamp('25/09/03 16:04:04.718346000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (24,'【QR解錠】一部機種での試験運用','QRコードによる解錠機能を一部で試験導入中です。対応ロッカーは表示ラベルをご確認ください。',3,to_timestamp('25/09/03 16:04:04.727920000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (25,'【機器更新】決済端末の交換作業','老朽化した決済端末の交換を順次行います。作業中は現金のみ、またはICのみの対応となる場合があります。',1,to_timestamp('25/09/03 16:04:04.738027000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (26,'【サイズ表記】大型荷物の目安','三辺合計が160cmを超える荷物は特大サイズをご利用ください。収まらない場合は手荷物預かりをご案内します。',2,to_timestamp('25/09/03 16:04:04.747004000','RR/MM/DD HH24:MI:SSXFF'));
Insert into USER1.NOTICES (ID,TITLE,CONTENT,AUTHOR_ID,CREATED_AT) values (27,'【遺失物】忘れ物の取り扱い','期限経過後の荷物や落とし物は所定の手続きを経て保管・処理します。お心当たりの方は管理センターへ。',3,to_timestamp('25/09/03 16:04:04.759494000','RR/MM/DD HH24:MI:SSXFF'));
